Vue.component("disclaimer-dialog", {
    data: function () {
        return { showDialog: !1, companyData: [], ids: [] };
    },
    template:
        '\x3cdiv class\x3d"disclaimer-d-wrapper"\x3e\n                \x3cdiv class\x3d"centerdialog-wrapper" :class\x3d"{ show: showDialog }"\x3e\n                    \x3cdiv class\x3d"dialog-title"\x3e\n                        \x3cdiv class\x3d"tb-Grid tb-Grid--16 tb-Grid--l--16 tb-Grid--m--16 tb-Grid--s--20 tb-Grid--xs--24"\x3e\n                            \x3cdiv class\x3d"tb-GridColumn tb-GridColumn--l--14 tb-GridColumn--m--14 tb-GridColumn--s--18 tb-GridColumn--xs--20 tb-GridColumn--offset--l--1 tb-GridColumn--offset--m--1 tb-GridColumn--offset--s--1 tb-GridColumn--offset--xs--2"\x3e\n                                \x3ch4 class\x3d"h4 color-white"\x3e{{title}}\x3c/h4\x3e\n                            \x3c/div\x3e\n                        \x3c/div\x3e\n                        \x3cspan class\x3d"icon icon-times-white" @click\x3d"closeDialog"\x3e\n                            \x3cspan class\x3d"path1"\x3e\x3c/span\x3e\x3cspan class\x3d"path2"\x3e\x3c/span\x3e\x3cspan class\x3d"path3"\x3e\x3c/span\x3e\x3cspan class\x3d"path4"\x3e\x3c/span\x3e\n                        \x3c/span\x3e\n                    \x3c/div\x3e\n                    \x3cdiv class\x3d"dialog-content tb-Grid tb-Grid--16 tb-Grid--l--16 tb-Grid--m--16 tb-Grid--s--20 tb-Grid--xs--24"\x3e\n                        \x3cdiv class\x3d"tb-GridColumn tb-GridColumn--l--14 tb-GridColumn--m--14 tb-GridColumn--s--18 tb-GridColumn--xs--20 tb-GridColumn--offset--l--1 tb-GridColumn--offset--m--1 tb-GridColumn--offset--s--1 tb-GridColumn--offset--xs--2"\x3e\n                            {{content}}\n                        \x3c/div\x3e                       \n                    \x3c/div\x3e\n                    \x3cdiv class\x3d"tb-Grid tb-Grid--16 tb-Grid--l--16 tb-Grid--m--16 tb-Grid--s--20 tb-Grid--xs--24"\x3e\n                        \x3cdiv class\x3d"dialog-footer tb-GridColumn tb-GridColumn--l--14 tb-GridColumn--m--14 tb-GridColumn--s--18 tb-GridColumn--xs--20 tb-GridColumn--offset--l--1 tb-GridColumn--offset--m--1 tb-GridColumn--offset--s--1 tb-GridColumn--offset--xs--2"\x3e\n                            \x3cdiv class\x3d"dialog-footer-item"\x3e\n                                \x3cdiv class\x3d"decline-wrapper m-m-right" @click\x3d"decline"\x3e\n                                    \x3cspan class\x3d"text"\x3e{{getString(\'I do not agree\')}}\x3c/span\x3e\n                                \x3c/div\x3e\n                            \x3c/div\x3e\n                            \x3cdiv class\x3d"dialog-footer-item"\x3e\n                                \x3cbutton class\x3d"button button-link-animation" @click\x3d"agree"\x3e\n                                    \x3cspan class\x3d"text"\x3e{{getString(\'I agree\')}}\x3c/span\x3e\n                                    \x3cspan class\x3d"icon icon-right-arrow"\x3e\x3c/span\x3e\n                                \x3c/button\x3e\n                            \x3c/div\x3e\n                        \x3c/div\x3e\n                    \x3c/div\x3e\n                \x3c/div\x3e\n            \x3c/div\x3e',
    methods: {
        toggleDialog: function () {
            (this.showDialog = !this.showDialog) && 1280 >= window.innerWidth ? VueBus.preventBodyScroll() : VueBus.allowBodyScroll();
        },
        closeDialog: function () {
            this.showDialog = !1;
            VueBus.allowBodyScroll();
        },
        getString: function (a) {
            return Granite.I18n.get(a);
        },
        agree: function () {
            VueBus.$emit("agreeDisclaimer", this.ids);
            this.closeDialog();
        },
        decline: function () {
            VueBus.$emit("declineDisclaimer");
            this.closeDialog();
        },
    },
    mounted: function () {
        var a = this;
        VueBus.$on("setContent", function (b) {
            a.content = b.content;
            a.title = b.title ? b.title : a.title;
        });
        VueBus.$on("showDisclaimer", function (b) {
            a.ids = b;
            a.toggleDialog();
        });
    },
    props: { title: { type: String, default: Granite.I18n.get("Disclaimer statement") }, content: String },
});
